var sort_on_filter = function(dd){
	if (disabled.length > 0 && choosed_tags.length > 0){
		if (disabled.indexOf(dd.filter) > -1){
			if (dd.tags.length > 0){
				for (t = 0; t < dd.tags.length; t++){
					if (choosed_tags.indexOf(dd.tags[t]) > -1){
						return true;
					}else{
						return false;
					}
				}
			}else{
				return false;
			}
		}else{
			return false;
		}
	}else if(disabled.length > 0 && choosed_tags.length <= 0){
		if (disabled.indexOf(dd.filter) > -1){
			return true
		}
	}else if(disabled.length <= 0 && choosed_tags.length > 0){
		if (dd.tags.length > 0){
				for (t = 0; t < dd.tags.length; t++){
					if (choosed_tags.indexOf(dd.tags[t]) > -1){
						return true;
					}else{
						return false;
					}
				}
		}else{
			return false;
		}
	}else{
		console.log("No filter has been applied")
		return true; // equals to a pass
	}
}

var addGamesDots = function(d){
  var url_heading = "http://7450_image_api.wuzizheng.com/location/"
  for (game = 0; game < d.length; game++){
    url = url_heading + d[game] + ".json";
    var game_time_id = d[game];
    //console.log(url);
    //console.log(d[game]);
    $.ajax({      
      type: 'GET',
      url: url,
      dataType: 'json',
      async: true,
            cache: true,
            timeout: 10000,
            success: function(data){
                if(data && data.length > 0){
                  data.forEach(function(obj) {
                    //console.log(game_time_id + ' : ' + obj.created_time); 
                    //console.log(obj);
                    if (Math.random() > 0.95){
                    	if (sort_on_filter(obj) == true) {
                            if (obj.caption != null && obj.caption.text != null) {
                                    appendData(obj.location.id, new Date(obj.created_time * 1000),obj.images.low_resolution.url, obj.filter, obj.tags, obj.likes.count, obj.location, obj.caption.text, obj.caption.from.id);
                            }
                    	}
                	}
                  });
                };
              setTimeout(appendData, 2000);
          },
          error: function(XMLHttpRequest, textStatus, errorThrown){
              console.log(textStatus + ', ' + errorThrown);
              setTimeout(appendData, 5000);
          }
    });
  }
}

