var addGamesDots_new = function(gameid){
  for (u = 0; u < 50; u++){
      var url_heading = "http://7450_image_api.wuzizheng.com/user/"
      url = url_heading + location_user_dict[gameid][u] + ".json";
      $.ajax({      
      type: 'GET',
      url: url,
      dataType: 'json',
      async: true,
            cache: true,
            timeout: 10000,
            success: function(data){
                if(data && data.length > 0){
                  data.forEach(function(obj) {
                    //console.log(game_time_id + ' : ' + obj.created_time); 
                    //console.log(obj);
                    	if (sort_on_filter(obj) == true){
                            if (obj.caption != null && obj.caption.text != null) {
                                appendData(gameid, new Date(obj.created_time * 1000),obj.images.low_resolution.url, obj.filter, obj.tags, obj.likes.count, obj.location, obj.caption.text, obj.caption.from.full_name);
                            }
                      	}
                    });
                };
              setTimeout(appendData, 2000);
            },
          error: function(XMLHttpRequest, textStatus, errorThrown){
              console.log(textStatus + ', ' + errorThrown);
              setTimeout(appendData, 5000);
          }
    });
    }
}
